import React, { useEffect } from "react";
import Weather from "./components/Weather";

const App= () =>
{
  useEffect(()=>{
    navigator.geolocation.getCurrentPosition((positions)=>{
      console.log(positions);
    })
  },[])
  return(
    <>
      <div id="page_wrapper">
        <Weather/>
      </div>
    </>
  )
}

export default App;
